import React, { useContext } from "react";
import { UserContext } from "./App.js";

const PersonalPage = () => {
  const userData = useContext(UserContext);
  return (
    <div>
      <div>
        <img src={userData.profilePicture} alt="User" />
        <h3>{userData.displayName}</h3>

        <div>
          <h3>NUMBER</h3>
          <p>Completed Games</p>
        </div>
        <div>
          <h3>NUMBER</h3>
          <p>Best Game</p>
        </div>
        <div>
          <h3>NUMBER</h3>
          <p>Average Game</p>
        </div>
      </div>
    </div>
  );
};

export default PersonalPage;
